	const { price, ctg, imgUrl, rate, name } = stay;

	return (
		<main>
			<h1>Stay Details</h1>
			<h4>stay title {name}</h4>
			<div className="stay-short-info">
				<div>
					<p>4.5 start</p>
					<p>tel aviv arlozorov</p>
				</div>
				<div>
					<button>share</button>
					<button>save</button>
				</div>
			</div>
		</main>
	);
}
